INSERT INTO `v3_email` (`email_id`, `email_subject`, `email_from_address`, `email_content`) VALUES
(1, 'New Account Created', 'admin@cba.com', '<p>Hi {uname}!</p>\r\n\r\n<p>You account has been successfully created. &nbsp;Welcome to CBA! Your new password is:</p>\r\n\r\n<p>Password: {psw}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Warm Regards,</p>\r\n\r\n<p><strong>CBA Admin</strong></p>'),
(2, 'Forget Password', 'admin@cba.com', '<p>Hi {uname}!</p><p>\r\n\r\nYou have requested to change your account password. To reset Your new password click on link:</p><p>\r\n {link}\r\n\r\n\r\n</p><p><br></p><p>Warm Regards,\r\n\r\n</p><p><span style="font-weight: bold;">CBA  Admin</span></p>'),
(3, 'Reset Password', 'admin@cba.com', '<p>Hi {uname}!</p><p>\r\n\r\nYour password has been reset. Your new password is:</p><p>\r\nPassword: {psw}\r\n\r\n\r\n</p><p><br></p><p>Warm Regards,\r\n\r\n</p><p><span style="font-weight: bold;">CBA Admin</span></p>'),
(4, 'Manual Curation', 'admin@cba.com', '<p>Hi MDX, please attend to the Manual curation of the below items:</p>\r\n\r\n<ul>\r\n	<li>Company Id: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;{company_id}</li>\r\n	<li>Site id: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; {site_id}</li>\r\n	<li>&quot;allow_additional_images&quot;: &nbsp; &nbsp;{allow_addtional_images}</li>\r\n	<li>&quot;enhance_product_names&quot;: &nbsp; &nbsp; {enhance_product_images}</li>\r\n	<li>Number of products: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;{no_of_products}</li>\r\n	<li>Number of Categories: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;{no_of_categories}</li>\r\n	<li>Number of option_sets: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;{no_of_optionsets}</li>\r\n</ul>\r\n\r\n<p>Clarification re &quot;allow_additional_images&rdquo;&nbsp;and &quot;enhance_product_names&quot; fields:</p>\r\n\r\n<ul>\r\n	<li><strong>&quot;allow_additional_images&rdquo;</strong></li>\r\n</ul>\r\n\r\n<p style="margin-left:85.6pt">&ldquo;True&rdquo; - Plutus to supply all the missing images for Products. Images should be landscape shot with minimum 1440/900 resolution</p>\r\n\r\n<p style="margin-left:85.6pt">&ldquo;False&rdquo; - Plutus not to supply any the missing images</p>\r\n\r\n<ul>\r\n	<li><strong>&quot;enhance_product_names&quot;</strong>&nbsp;</li>\r\n</ul>\r\n\r\n<p style="margin-left:85.6pt">&ldquo;True&rdquo; &ndash; perform Manual curation (e.g. like changing &ldquo;Cap&rdquo; to &ldquo;Cappuccino&rdquo;) on the Product Name</p>\r\n\r\n<p style="margin-left:85.6pt">&ldquo;False&rdquo; &ndash; don&rsquo;t perform Manual curation (advice on the more suitable product name etc.) on the Product Name</p>');
